package algorithms.specialpalindromeagain;

import algorithms.specialpalindromeagain.Solution.Pair;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.extension.ExtensionContext;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.ArgumentsProvider;
import org.junit.jupiter.params.provider.ArgumentsSource;

import java.util.Arrays;
import java.util.Collections;
import java.util.List;
import java.util.stream.Stream;

import static algorithms.specialpalindromeagain.Solution.tokenizeString;

public class SolutionTest implements ArgumentsProvider {

  @Override
  public Stream<? extends Arguments> provideArguments(ExtensionContext extensionContext) {
    return Stream.of(
      Arguments.of(7, "asasd"),
      Arguments.of(10, "abcbaba"),
      Arguments.of(12, "mnonopoo"),
      Arguments.of(10, "aaaa"),
      Arguments.of(15, "aaaaa"),
      Arguments.of(66516, ""));
  }

  static class PalindromeTestArgProvider implements ArgumentsProvider {

    @Override
    public Stream<? extends Arguments> provideArguments(ExtensionContext extensionContext) {
      return Stream.of(
        Arguments.of(true, "aba", 0, 2),
        Arguments.of(true, "aa", 0, 1),
        Arguments.of(true, "fasfbabafasfa", 7, 9),
        Arguments.of(false, "fasfbabafasfa", 3, 5)
      );
    }
  }

  static class TokenizeStringArgProvider implements ArgumentsProvider {
    @Override
    public Stream<? extends Arguments> provideArguments(ExtensionContext extensionContext) {
      return Stream.of(
        Arguments.of(Arrays.asList(
          Pair.of('m', 1),
          Pair.of('n', 1),
          Pair.of('o', 1),
          Pair.of('n', 1),
          Pair.of('o', 1),
          Pair.of('p', 1),
          Pair.of('o', 2)
        ), "mnonopoo"),
        Arguments.of(Collections.singletonList(Pair.of('a', 4)), "aaaa"),
        Arguments.of(Arrays.asList(
          Pair.of('a', 1),
          Pair.of('s', 1),
          Pair.of('a', 1),
          Pair.of('s', 1),
          Pair.of('d', 1)
        ), "asasd")
      );
    }
  }

  @ParameterizedTest
  @ArgumentsSource(PalindromeTestArgProvider.class)
  void isPalindrome(boolean expected, String input, int startIndex, int endIndex) {
    Assertions.assertEquals(expected, Solution.isSpecialPalindrome(input, startIndex, endIndex));
  }

  @ParameterizedTest
  @ArgumentsSource(SolutionTest.class)
  void solveAlternative(int expected, String input) {
    Assertions.assertEquals(expected, Solution.solveAlternative(input));
  }

  @ParameterizedTest
  @ArgumentsSource(TokenizeStringArgProvider.class)
  void testTokenizeString(List<Pair> expected, String input) {
    Assertions.assertIterableEquals(expected, tokenizeString(input));
  }
}
